%[text] # Test Script for Converting Live Script to Markdown format
%[text] This is a test live script, seeing if I can convert the live script into markdown (.md) format. the goal is to work out examples in MATLAB livescript which then is converted to markdown and available for review in github and other sources
%Here is some silly code
x = randi(50,[50 1]);
y = randi(100,[50 1]);

result = x + y %[output:9e40c61e]
%%
%[text] ## Testing the use of controls in live script, and how they translate in an .md file
%[text] MATLAB has these control features that can be added into live scripts. They might be useful for interactive examples and modifications, but it is unclear how the format will translate to the .md file. 
%Test out the addition of controls
%this checkbox will simply rerun the livescript when clicked
selection = true %[control:checkbox:5505]{"position":[13,17]} %[output:748c423f]
%Lets try another. The color picker
color = [0.522 0.086 0.820] %[control:colorPicker:8dea]{"position":[9,28]} %[output:3919ec6c]
%[text] Conclusion: Live code control tools simply do not show up in any markdown, html, or notebook format.
%%
%[text] ## Trying out the live coder tasks
%[text] MATLAB has some preformatted coding operations to implement. let's see how these look.
% Create plot of x and y %[task:5c68]
h = plot(x,y,"DisplayName","y"); %[output:640c2126]

% Add xlabel, ylabel, title, and legend
xlabel("x") %[output:640c2126]
ylabel("y") %[output:640c2126]
title("y vs. x") %[output:640c2126]
legend %[task:5c68] %[output:640c2126]
%[text] **Conclusion**: The live script editor is a viable choice for producing example scripts for AIDIF initiatives, as the new .m file is readable in git and can be converted into several formats like markdown to make the examples easier to reference.
